window.bookSummaryJSON = "<p>Featuring <i>A Prelude to War</i>, an Iron Druid novella<b> </b></p> <p><b><i>A Prelude to War</i></b> by Kevin Hearne: After an old friend is murdered in retaliation for his mercenary strikes against the oldest vampires in the world, Atticus O'Sullivan must solicit the aid of another old friend in Ethiopia if he's going to have a chance of finishing a war he never wanted. Meanwhile Granuaile MacTiernan starts a private war of her own against Loki, the lord of lies, and if it brings Ragnarok early - so be it. </p> <p><b><i>Not My Circus, Not My Monkeys</i></b> by Delilah S. Dawson: The number-one rule of the circus? Don't kill your volunteers, even accidentally. That's how young magician Criminy Stain ends up on the run in a forest, where he meets a beautiful woman holding a bucket of blood. But is Merissa the answer to his prayers - or the orchestrator of his ruin? </p> <p><b><i>Interlude: Swallow</i></b> by Chuck Wendig: Miriam Black is back. Miriam is tired of her curse and finally believes she knows how to be rid of her ability to see when and how other people die. She follows a lead to the mountains of Colorado, where she believes she sees signs of a serial killer she thought she already killed. (Set between <i>The Cormorant</i> and <i>Thunderbird</i>.) </p>"; 
